// /frontend/src/App.js

import React, { useState } from 'react';
import UploadForm from './components/UploadForm';
import ChatWindow from './components/ChatWindow';
import ResultsDisplay from './components/ResultsDisplay';

function App() {
  const [appState, setAppState] = useState('initial'); // 'initial', 'loading', 'results', 'error'
  const [uploadedImage, setUploadedImage] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [error, setError] = useState('');
  const [chatKey, setChatKey] = useState(1);

  const handleAnalyze = async (file) => {
    setUploadedImage(file);
    setAppState('loading');
    setError('');
    setAnalysisResult(null);

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await fetch('http://localhost:5000/api/analyze', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        const errData = await response.json();
        throw new Error(errData.error || `HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setAnalysisResult(data);
      setAppState('results');
      setChatKey(prevKey => prevKey + 1);

    } catch (err) {
      console.error("Analysis failed:", err);
      setError(err.message);
      setAppState('error');
    }
  };

  const handleClear = () => {
    setAppState('initial');
    setUploadedImage(null);
    setAnalysisResult(null);
    setError('');
    setChatKey(prevKey => prevKey + 1);
  };

  const renderLeftPanel = () => {
    switch (appState) {
      case 'initial':
        return <UploadForm onAnalyze={handleAnalyze} isLoading={false} />;
      case 'loading':
        return <ResultsDisplay isLoading={true} />;
      case 'results':
        return <ResultsDisplay uploadedImage={uploadedImage} analysisResult={analysisResult} isLoading={false} />;
      case 'error':
        return (
          <div className="h-full flex flex-col items-center justify-center text-center p-4">
            <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded-lg" role="alert">
              <strong className="font-bold">Analysis Failed: </strong>
              <span className="block sm:inline">{error}</span>
            </div>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center p-4 sm:p-6 lg:p-8">
      {/* --- This is the new Header Section --- */}
      <header className="text-center mb-8">
        <h1 className="text-4xl font-bold text-gray-800">
          Pneumonia Detection using X-Ray Analysis
        </h1>
        <p className="mt-2 text-lg text-gray-600">
          An AI-powered tool to assist with preliminary diagnosis.
        </p>
      </header>
      {/* --- End of Header Section --- */}

      <div className="w-full max-w-6xl mx-auto bg-white rounded-2xl shadow-2xl flex flex-col lg:flex-row overflow-hidden" style={{height: 'calc(100vh - 10rem)'}}>
        
        {/* Left Panel */}
        <div className="w-full lg:w-1/2 p-6 flex flex-col">
          <div className="flex justify-between items-center mb-4">
            <h2 className="text-2xl font-bold text-gray-800">X-Ray Analysis</h2>
            {appState !== 'initial' && (
              <button 
                onClick={handleClear}
                className="text-sm bg-gray-200 hover:bg-gray-300 text-gray-700 font-semibold py-1 px-3 rounded-lg transition-colors"
              >
                Start Over
              </button>
            )}
          </div>
          <div className="flex-grow relative">
            {renderLeftPanel()}
          </div>
        </div>

        {/* Right Panel */}
        <div className="w-full lg:w-1/2 p-6 flex flex-col bg-gray-50 border-l">
          <h2 className="text-2xl font-bold text-gray-800 mb-4">AI Assistant</h2>
          <div className="flex-grow">
            <ChatWindow 
              key={chatKey} 
              analysisContext={analysisResult ? JSON.stringify(analysisResult, null, 2) : ''} 
            />
          </div>
        </div>

      </div>
    </div>
  );
}

export default App;
